import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import WalletConnector from './components/WalletConnector';
import Kayit from './components/Kayit';
import MainPage from './components/MainPage';
import PrayerTimes from './components/PrayerTimes';
import DailyPrayers from './components/DailyPrayers';
import Hadiths from './components/Hadiths';
import Dhikr from './components/Dhikr';
import NamesOfAllah from './components/AllahIsimleri';
import Sacrifice from './components/Sacrifice';
import NonVisualization from './components/NonVisualization';
import DAO from './components/DAO';
import SurahList2 from './components/SurahList2';
import SurahTranslation from './components/SurahTranslation';
import SurahOriginal from './components/SurahOriginal';
import ProfilePage from './components/ProfilePage';
import ToDoList from './components/ToDoList';
import NewPage from './components/NewPage'; // Import NewPage component
import Layout from './components/Layout'; // Import Layout component
import './App.css';

function App() {
  const [walletConnected, setWalletConnected] = useState(localStorage.getItem('walletConnected') === 'true');
  const [languageSelected, setLanguageSelected] = useState(localStorage.getItem('selectedLanguage') !== null);

  const handleWalletConnection = () => {
    setWalletConnected(true);
    localStorage.setItem('walletConnected', 'true');
  };

  const handleLanguageSelection = (language) => {
    setLanguageSelected(true);
    localStorage.setItem('selectedLanguage', language);
  };

  return (
    <Router>
      <div className="App">
        {walletConnected && languageSelected && <NavBar />}
        <Routes>
          <Route path="/wallet" element={<WalletConnector onConnectWallet={handleWalletConnection} />} />
          <Route path="/kayit" element={<Kayit onSelectLanguage={handleLanguageSelection} />} />
          <Route path="/main" element={<Layout><MainPage /></Layout>} />
          <Route path="/prayer-times" element={<Layout><PrayerTimes /></Layout>} />
          <Route path="/daily-prayers" element={<Layout><DailyPrayers /></Layout>} />
          <Route path="/hadiths" element={<Layout><Hadiths /></Layout>} />
          <Route path="/dhikr" element={<Layout><Dhikr /></Layout>} />
          <Route path="/names-of-allah" element={<Layout><NamesOfAllah /></Layout>} />
          <Route path="/quran-verses" element={<Layout><SurahList2 /></Layout>} />
          <Route path="/surah-translation/:surahNumber" element={<Layout><SurahTranslation /></Layout>} />
          <Route path="/sacrifice" element={<Layout><Sacrifice /></Layout>} />
          <Route path="/non-visualization" element={<Layout><NonVisualization /></Layout>} />
          <Route path="/dao" element={<Layout><DAO /></Layout>} />
          <Route path="/surah-original/:surahNumber" element={<Layout><SurahOriginal /></Layout>} />
          <Route path="/profile" element={<Layout><ProfilePage /></Layout>} />
          <Route path="/todo-list" element={<Layout><ToDoList /></Layout>} />
          <Route path="/new-page" element={<Layout><NewPage /></Layout>} /> {/* New Page route */}
          <Route
            path="/"
            element={
              !languageSelected ? (
                <Navigate to="/kayit" />
              ) : !walletConnected ? (
                <Navigate to="/wallet" />
              ) : (
                <Navigate to="/main" />
              )
            }
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
